import React, { useState } from 'react';
import { FiMenu } from 'react-icons/fi';
import { RxCross1 } from 'react-icons/rx';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [nav, setNav] = useState(false);
  const handleNav = () => {
    setNav(!nav);
  };

  return (
      <div className='flex justify-between items-center h-24 max-w-[1200px] mx-auto px-auto text-white'>
        <h1 className='w-full text-4xl text-amber-400 font-extrabold'>UrbanRoost</h1>
        <ul className=' hidden md:flex '>
          <li className='p-4'> Home</li>
          <li className='p-4'>About</li>
          <li className='p-4'>Contact</li>
          <li className='p-4'>
            <Link to="/SignUp">Sign Up</Link>
          </li>
          <li className='p-4'>
            <Link to="/SignIn">Sign In</Link>
          </li>
        </ul>
        <div onClick={handleNav} className='block md:hidden'>
          {!nav ? <RxCross1 size={20} /> : <FiMenu size={20} />}
        </div>
        <div className={!nav ? 'fixed left-0 top-0 w-[50%] h-full border-r border-r-gray-500 bg-gray-400 ease-in-out duration-300' : 'fixed left-[-100%]'}>
          <div className='flex'>
            <div className='inline-block'>
              <h1 className='w-full text-4xl text-amber-400 font-extrabold m-auto p-auto'>UrbanRoost</h1>
            </div>
            <div onClick={handleNav} className='inline-block ml-auto pt-3'>
              {!nav ? <RxCross1 size={20} /> : <FiMenu size={20} />}
            </div>
          </div>

          <ul className='uppercase p-4'>
            <li className='p-4 border-b border-b-gray-500'>Home</li>
            <li className='p-4 border-b border-b-gray-500'>About</li>
            <li className='p-4 border-b border-b-gray-500'>Contact</li>
            <li className='p-4'>Login</li>
          </ul>
        </div>
      </div>
  );
};

export default Navbar;
